INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES ("ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 130011, "2030/01/01 14:59:59", 100, 3001, 2.1, "ヤマト", 1, 3001100, "2024/10/31 12:00:00", -416.5, 0.0, 2);
